// Main function
int tripletquizzer() {
#ifdef _WIN32
    enableANSI(); // Enable ANSI support on Windows
#endif
    // Group indices by their values (w, a, s, d)
    int *groups[4],         // Array of pointers to store indices for each group
        group_sizes[4];     // Sizes of each group
    group_indices_by_value(values, groups, group_sizes);

    // Seed the random number generator
    srand(time(NULL));

    // Start the quiz

    while (getchar() != '\n'){}
    printf("This quiz tests you on how fast you can see 3 letter words.)\n"
           "If reading the letters left to right forms a word, e.g. ALT, press A\n"
           "If reading the letters right to left forms a word, e.g. UYR, press D\n"
           "If reading the letters in either direction both form words, e.g. LET, press W\n"
           "If there are no words, press S\n"
           "Press space to exist and see your averages");
    int question = 0, score = 0;
    // Start tracking time
    time_t start_time, end_time;
    time(&start_time);
    while (1) {
        char input;
        // Randomly select a target value group (0 = 'w', 1 = 'a', 2 = 's', 3 = 'd')
        const int target_group = rand() % 4;

        // Randomly select an index within the chosen group
        const int random_index = groups[target_group][rand() % group_sizes[target_group]];

        // Convert the index to a three-letter combination
        char combination[4];
        index_to_combination(random_index, combination);

        // Ask the user
        printf("\n%d: Is '%s' a word?\n", ++question, combination); // Add a newline after the question
        printf("> "); // Prompt for user input (optional visual indicator)

        // Read the user's input
        scanf("%c", &input); // Space before %c skips leading whitespace
        while (getchar() != '\n'){}
        // Exit condition
        if (input == ' ') break;
        input = toupper(input);
        // Handle invalid input
        if (strchr("WASD", input) == NULL) {
            printf("Invalid input. Please enter W, A, S, or D.\n");
            continue; // Skip to the next iteration
        }

        if (values[random_index] == input) {
            printf("Correct\n");
            ++score;
        } else {
            printf("Incorrect. The correct value is %c.\n", values[random_index]);
        }

        // Display the score
        printf("Score: %d\n", score);
    }

    // End tracking time
    time(&end_time);
    const double elapsed_time = difftime(end_time, start_time);
    printf("Elapsed time: %f seconds\n"
           "Accuracy: %d%%\n"
           "Time per question: %f seconds\n", elapsed_time, 100*score/question, elapsed_time/question);
    return 0;
}